package Iterations;


public class Pattern5_Q11 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for(int i=1;i<=5;i++) {
			int temp=1;
			for(int j=1;j<=i;j++)
			{	
				System.out.print(temp+" ");
				temp++;
			}
			System.out.println();
		}
	}

}
